import React, {useEffect,useState} from "react";
import "./gerencia.css";
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import axios from 'axios';
import back_gerencia from '../../img/back_gerencia.jpg';
import StyledTableCell from "../../styles/StyledTableCell";
import StyledTableRow from "../../styles/StyledTableRow";
import DeleteForeverOutlinedIcon from '@mui/icons-material/DeleteForeverOutlined';
import EditOutlinedIcon from '@mui/icons-material/EditOutlined';
import { IconButton } from "@mui/material";
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';
import Slide from '@mui/material/Slide';

function Gerencia () {

    const Transition = React.forwardRef(function Transition(props, ref) {
        return <Slide direction="up" ref={ref} {...props} />;
    });


    const [open, setOpen] = React.useState(false);

    const handleClickOpen = () => {
        setOpen(true);
    };

    const handleClose = () => {
        setOpen(false);
    };

    const [usuario, setUsuario] = useState([]);

    useEffect( () =>  {
        axios.get('http://127.0.0.1:8000/cadastras')
          .then(res => {
            setUsuario(res.data)
          })
          .catch(err => {
            console.log(err)
          })
    })

    function Delete (cadastra_id) {
        axios.delete(`http://127.0.0.1:8000/cadastras/${cadastra_id}/`)
            .then(() => {
                console.log('DELETADO')
            })
            .catch(err => {
                console.log(err)
            })
    }

    return (
        <div id="corpo_tabela" >

            <img src={back_gerencia}/>
            <div id="paper">
                <h1>Gerenciador de Usuarios</h1>

                <hr/>

                <div id="tabela">
                    <TableContainer component={Paper}>
                        <Table sx={{ minWidth: 700 }} aria-label="customized table">
                            <TableHead>
                                <TableRow>
                                    <StyledTableCell>Nome </StyledTableCell>
                                    <StyledTableCell align="right">E-mail</StyledTableCell>
                                    <StyledTableCell align="right">Numero</StyledTableCell>
                                    <StyledTableCell align="right">Endereço</StyledTableCell>
                                    <StyledTableCell align="right">Profissão</StyledTableCell>
                                    <StyledTableCell align="right">Ações</StyledTableCell>
                                </TableRow>
                            </TableHead>
                            <TableBody>
                            {usuario.map((usuarios) => (
                                <StyledTableRow key={usuarios.cadastra_id}>
                                    <StyledTableCell component="th" scope="row">
                                        {usuarios.nome}
                                    </StyledTableCell>
                                    <StyledTableCell align="right">{usuarios.email}</StyledTableCell>
                                    <StyledTableCell align="right">{usuarios.telefone}</StyledTableCell>
                                    <StyledTableCell align="right">{usuarios.end}</StyledTableCell>
                                    <StyledTableCell align="right">{usuarios.prof}</StyledTableCell>
                                    <StyledTableCell align="right">
                                        <IconButton color="error" >
                                            <DeleteForeverOutlinedIcon onClick={Delete(usuarios.cadastra_id)}/>
                                        </IconButton>
                                        <IconButton color='inherit'>
                                            <EditOutlinedIcon/>
                                        </IconButton>
                                    </StyledTableCell>
                                </StyledTableRow>

                            ))}
                            </TableBody>
                        </Table>
                    </TableContainer>

                    <Dialog
                                    open={open}
                                    TransitionComponent={Transition}
                                    keepMounted
                                    onClose={<a href='/home'></a>}
                                    aria-describedby="alert-dialog-slide-description"
                                >
                                    <DialogTitle>{"Suas Informações foram Enviadas !!!"}</DialogTitle>

                                    <DialogContent>
                                        <DialogContentText id="alert-dialog-slide-description">
                                            Seus dadaos foram eviados com sucesso.
                                            Clique no menu Gerenciador, ou botão prosseguir logo abaixo
                                            para ver as alterações que foram realizadas. 
                                        </DialogContentText>
                                    </DialogContent>
                                    <DialogActions>
                                        <Button color='secondary'><a href='/cadastro'>Reiniciar</a></Button>
                                        <Button color='secondary'><a href='/gerencia'>Proceguir</a></Button>
                                    </DialogActions>
                                </Dialog>
                </div>
            </div>
        </div>
    )
}

export default Gerencia;
